class Result<T, E> {
    private final boolean isOk;
    private final T value;
    private final E error;

    private Result(boolean isOk, T value, E error) {
        this.isOk = isOk;
        this.value = value;
        this.error = error;
    }

    public static <T, E> Result<T, E> ok(T value) {
        return new Result<>(true, value, null);
    }

    public static <T, E> Result<T, E> err(E error) {
        return new Result<>(false, null, Objects.requireNonNull(error));
    }

    public boolean isOk() {
        return isOk;
    }

    public T unwrap() {
        if (!isOk) throw new IllegalStateException("Called unwrap on an Err result");
        return value;
    }

    public E unwrapErr() {
        if (isOk) throw new IllegalStateException("Called unwrapErr on an Ok result");
        return error;
    }

    @Override
    public String toString() {
        return isOk ? "Ok(" + value + ")" : "Err(" + error + ")";
    }
}

